import{_ as l}from"./chunks/FanTools_LoginWindow_Fan_0.2.3.CjMUbkpA.js";import{_ as r,c as i,aA as n,G as t,B as a,o as c}from"./chunks/framework.BKWMtcQE.js";const p="/assets/FanTools_View_0.2.2.DrIiSOSB.png",v=JSON.parse('{"title":"芒果工具箱文档中心","description":"","frontmatter":{},"headers":[],"relativePath":"fantools/description.md","filePath":"fantools/description.md","lastUpdated":1739893776000}'),d={name:"fantools/description.md"};function u(m,o,_,b,f,h){const s=a("NolebaseGitContributors"),e=a("NolebaseGitChangelog");return c(),i("div",null,[o[0]||(o[0]=n('<h1 id="芒果工具箱文档中心" tabindex="-1">芒果工具箱文档中心 <a class="header-anchor" href="#芒果工具箱文档中心" aria-label="Permalink to &quot;芒果工具箱文档中心&quot;">​</a></h1><p><img src="'+l+'" alt="登录预览" data-zoomable="true"><img src="'+p+'" alt="预览图" data-zoomable="true"></p><p>芒果工具箱是基于Python3.11、PySide6和QFluentWidgets开发的开源工具箱程序，目标是包含不常用但偶尔急需的小众功能。</p><div class="warning custom-block"><p class="custom-block-title">开发中</p><p>工具箱目前仍在较为早期的开发阶段，工具箱本体已经基本完成开发，正在集中于内置工具的开发上。</p></div><div class="tip custom-block"><p class="custom-block-title">内置工具</p><p>目前已经完成开发的内置工具：</p><ul><li>文件哈希值计算器：HashCalculator</li></ul><p>直接搬来的芒果三年前写的垃圾小玩意：</p><ul><li>古典英语密码解释器：SimpleCrypt</li></ul><p>正在全新开发的工具：</p><ul><li>翻译家：Translator</li></ul></div><h2 id="关于本文档" tabindex="-1">关于本文档 <a class="header-anchor" href="#关于本文档" aria-label="Permalink to &quot;关于本文档&quot;">​</a></h2><p>您正在阅读的是基于<code>VitePress</code>实现，并通过GitHub Workflow自动化部署的 <strong>芒果工具箱文档</strong> 。</p><div class="info custom-block"><p class="custom-block-title">查看文档</p><p>本文档作为静态站点，仓库位于GitHub，您可以通过以下两个域名访问本站：</p><ul><li><code>docs-fantools.mangofanfan.cn</code> - 境外流量解析至 <strong>GitHub Pages</strong>，国内流量解析至 <strong>腾讯云CDN</strong>。</li><li><code>docs-fantools-preview.mangofanfan.cn</code> - 全部流量解析至位于南京的某个腾讯云COS存储桶。</li></ul><p>由于我也未曾料想到的原因，本文档现在是两度重构后的第三迭代，使用VitePress构建。</p></div><details class="details custom-block"><summary>您可能不知道</summary><p>工具箱的<code>0.0.0</code>、<code>0.0.1</code>和<code>0.1.0</code>三个版本曾经拥有基于Jetbrains WriterSide的旧版工具箱文档，旧文档已经下线，并且很遗憾已经被销毁。</p><p>工具箱也曾有过短暂（长达几天）的基于 <strong>MkDocs</strong> 构建的文档，并且初步实现了自动更新部署，但是效果差强人意……</p></details><h2 id="使用工具箱" tabindex="-1">使用工具箱 <a class="header-anchor" href="#使用工具箱" aria-label="Permalink to &quot;使用工具箱&quot;">​</a></h2><p>0.2.1与之后的早期版本需要通过安装程序安装在系统中，您可以选择为全体用户安装或仅为你安装，不影响程序使用。</p><p><strong><a href="/fantools/start_use.html">开始使用工具箱</a></strong> | <strong><a href="/devtool/structure.html">开始开发工具</a></strong> | <strong><a href="/about/contribute.html">贡献工具箱本体</a></strong></p><div class="info custom-block"><p class="custom-block-title">为何使用安装模式而不是单文件模式</p><p>工具箱以各种工具为核心，未来我们将提供基于市场的工具分享模式，允许用户之间交流他们各自的有趣或有用的工具。</p><p>这需要一个工具目录来存放工具，同时还有工具箱的自身配置和用户的数据，加上工具箱本身的体量也在膨胀，我们综合来看决定采用安装程序的模式分发程序。</p></div><p>0.0.x（早期技术验证）版本是重构之前的工具箱，采用命令行安装工具实现自动安装，或可由用户手动部署，此版本的工具箱本体是一个单文件程序。</p><p>不建议使用此版本的工具箱，因为其已经不受支持，且尚不完善。您可以从<a href="/about/version.html">版本页面</a>获取工具箱的所有发布过的版本。</p>',15)),t(s),t(e)])}const P=r(d,[["render",u]]);export{v as __pageData,P as default};
